"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[84383],{21933:(e,t,p)=>{p.r(t),p.d(t,{default:()=>n});const a=(0,p(66252).uE)('<h1 id="冬之语【十二】" tabindex="-1"><a class="header-anchor" href="#冬之语【十二】" aria-hidden="true">#</a> 冬之语【十二】</h1><div class="custom-container center"><p>浅冬夜里，万籁俱静，</p><p>草木沉睡，北风拂绕，</p><p>唯有些许的寒意，</p><p>从秋末那</p><p>蒹葭水岸的诗经里，</p><p>奔赴而来。</p><p>不知不觉间，</p><p>秋真的是远去了，</p><p>不得不挥手与秋道别。</p><p>只是秋末的这一场霾，</p><p>迷离了所有的眸光，</p><p>阳光悄然收起微笑，</p><p>大地在烟雾翩跹里，</p><p>无情掩埋。</p><p>吃过了立冬的饺子，</p><p>也便预示着</p><p>收获的季节已经结束，</p><p>峻峭的寒冬俨然到来，</p><p>在北国的寒冬里，</p><p>是否有人愿意，</p><p>温暖我的心?</p></div>',2),r={},n=(0,p(83744).Z)(r,[["render",function(e,t){return a}]])},83744:(e,t)=>{t.Z=(e,t)=>{const p=e.__vccOpts||e;for(const[e,a]of t)p[e]=a;return p}},7642:(e,t,p)=>{p.r(t),p.d(t,{data:()=>a});const a={key:"v-4a9da632",path:"/note/winter/12.html",title:"冬之语【十二】",lang:"zh-CN",frontmatter:{date:"2016-11-09T00:00:00.000Z",category:["随笔"],tag:["冬之语"],head:[["meta",{property:"og:url",content:"https://mrhope.site/note/winter/12.html"}],["meta",{property:"og:title",content:"冬之语【十二】"}],["meta",{property:"og:type",content:"article"}],["meta",{property:"og:locale",content:"zh-CN"}],["meta",{name:"twitter:card",content:"summary_large_image"}],["meta",{property:"article:tag",content:"冬之语"}],["meta",{property:"article:published_time",content:"2016-11-09T00:00:00.000Z"}],["script",{type:"application/ld+json"},'{"@context":"https://schema.org","@type":"NewsArticle","headline":"冬之语【十二】","image":[""],"datePublished":"2016-11-09T00:00:00.000Z","dateModified":"","author":[]}']]},excerpt:"",headers:[],git:{createdTime:1591204114e3,updatedTime:1644166018e3,contributors:[{name:"Mr.Hope",email:"zhangbowang1998@gmail.com",commits:4}]},readingTime:{minutes:.51,words:152},filePathRelative:"note/winter/12.md"}}}]);